    public static void main(String[] args) {

        ArrayList<Integer> rlePattern = new ArrayList<>();
        int previous = 0;
        int counter = 0;
        int ones = 0;
        int zeroes = 0;

        for (int i = 0; i < 100; i++) {
            for (int j = 0; j < 100; j++) {
                if (pattern[j + i * 100] == previous) {
                    counter++;
                } else {
                    rlePattern.add(counter);
                    counter = 1;
                    previous = pattern[j + i * 100];
                }
                if (pattern[j + i * 100] == 1) {
                    System.out.print("■");
                    ones++;
                } else {
                    System.out.print("□");
                    zeroes++;

                }
                System.out.println();                       //It Would be optimally stored in 2^8 for each number
                                                            // (biggest value being 76 with the longest string of uninterrupted repeats as black)
            }                                               // 6005 blacks and 3995 zeroes
            rlePattern.add(counter);

            System.out.println("Pattern length before compression " + pattern.length + " bits");
            System.out.println(rlePattern);
            System.out.println(ones +" "+ zeroes);
        }
    }
